PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE image_urls (
	"index" BIGINT, 
	urls TEXT
);
CREATE TABLE image_info (
	"index" BIGINT, 
	"Image_name" BIGINT, 
	"Image_url" TEXT, 
	"Width" BIGINT, 
	"Height" BIGINT, 
	"Color_channels" BIGINT, 
	"Download_datetime" DATETIME, 
	"Image_location" TEXT
);
CREATE INDEX ix_image_urls_index ON image_urls ("index");
CREATE INDEX ix_image_info_index ON image_info ("index");
COMMIT;
